export default class update extends Component {
    constructor(props){
        super(props);
        this.state={First_Name:'Roshan'}
    }
    render() {
        return (
            <div>
                <label>Enter the CID</label>
                <input
                type="text"
                name="First_Name"
                required
                disabled
                defaultValue = {this.props.First_Name}
            
               />
            </div>
        )
    }
}
